import React, { Component } from "react";
import { Row, Col } from "react-bootstrap";
import { Adoption } from "./Adoption";



export class LensAdvanced extends Component{
    render(){
        return(
            <div>

                <Row style={{ fontFamily: "Arial Black" }}>
                    <Col>Right Eye</Col>
                    <Col></Col>
                    <Col>Left Eye</Col>
                </Row>
                <hr></hr>

                <Row style={{ fontFamily: "Arial Black" }}>
                     <Col >Sphere(SPH)</Col>
                     <Col></Col>
                     <Col ></Col>
                </Row>
                <hr></hr>
                <Adoption />
                

            </div>
        )
    }
}
